import React, { useState, useEffect } from 'react';
import _Redux from '../Store/_Redux';

const FetchAllGenresOfMovies = props => {

    return (
        <React.Fragment>
            {/* FETCH_WAR_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=10752' />

            {/* FETCH_DRAMA_TV */}
            <_Redux FetchType="FETCH_TV" url='/discover/tv?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=37' />



            {/* FETCH_Science_Fiction_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=878' />

            {/* FETCH_WESTERN_MOVIE */}
            <_Redux FetchType="FETCH_MOVIE" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=37' />


        </React.Fragment>
    )
}

export default FetchAllGenresOfMovies;
